INSERT INTO "vehicleinspection" ("id", "trip_id", "vehicle_id", "kilometer", "engine_status", "tire_condition", "brake_status", "fuel_level", "notes", "inspection_date", "created_at", "status", "is_deleted") VALUES
('8c4599af-9f94-4968-a81d-4c481293dda8', '014a5efe-3af9-43de-933c-889b56abf736', '50a64b29-f413-4666-8338-c3ac088629a3', '131599', 'Faulty', 'Damaged', 'FailureImminent', '70', 'Hoc scribendi, etsi sit elegans, personae tamen et dignitatis esse negent. Contra quos omnis dicendum breviter existimo. Quamquam philosophiae quidem vituperatoribus satis responsum est eo libro, quo a populo Romano locatus sum.', '2024-04-27', '2025-03-18 07:22:44', 'Activo', '0'),
('14701f24-8b5b-4ea7-829c-808dcc776a57', 'b092bda0-83bb-4d10-9bbf-eee474480a31', '50a64b29-f413-4666-8338-c3ac088629a3', '450213', 'Faulty', 'New', 'FailureImminent', '61', 'Quae pertinerent ad bene vivendum aptior partitio quam illa, qua.', '2024-08-22', '2025-01-07 03:26:30', 'Activo', '0'),
('8214e9e8-d8cd-4a2c-9224-d0f1f003e1e5', '810430e1-abd7-4bdb-8e62-0e5a343ddfa2', '36fe1c48-d2cb-4a40-9419-d9d1ab0820e0', '13734', 'Running', 'New', 'Operational', '3', 'Dicturam pater aiebat, si loqui posset. Conclusum est enim contra Cyrenaicos satis acute, nihil ad Epicurum. Nam si concederetur, etiamsi ad corpus referri, nec ob eam causam non.', '2024-11-04', '2024-05-24 13:34:17', 'Activo', '1'),
('c45fdbe2-727d-472c-8b11-c43b7da0bc34', 'f3a837d9-734f-49d9-989f-0b0e5482abb9', 'e2bb2924-edb9-440d-8e56-36ee7ff316f0', '328512', 'Running', 'New', 'Operational', '23', 'Est summum esse bonum quicquam nisi nescio quam illam umbram, quod appellant honestum non tam solido quam splendido nomine, virtutem autem nixam hoc honesto nullam requirere voluptatem atque ad beate vivendum se ipsa esse contentam. Sed possunt haec quadam.', '2025-03-21', '2024-11-05 18:29:20', 'Activo', '0'),
